import React, { Component } from 'react'
import { Link, Route } from 'react-router-dom'
import RouterAgain from './RouterAgain'


export default class RouterTest extends Component {
    state={}
    show=()=>{
        console.log(this.state.input)
    }
    render() {
        return (
            <div>
                <input ref={(c)=>(this.setState={input:c})} onChange={this.show} placeholder='此处输入内容会被传递给1组件'></input>
                <input placeholder='此处输入内容会被传递给2组件'></input>               
                <h2>这是路由组件{this.props.location.search}</h2>
                <h2>传递参数为:id={this.props.match.params.id}
                    ,name={this.props.match.params.name}</h2>
                <Link to={`/jump1/jump-agin/${this.value1}`}>跳转🎧路由</Link>
                <Route path='/jump1/jump-again' component={RouterAgain}/>
            </div>
        )
    }
}
